import React from 'react';

function Main() {
  const handleEditAvatarClick = () => {
    document.querySelector('.popup_type_edit').classList.add('popup_open');
    document.querySelector('.profile__container').addEventListener('click', handleEditAvatarClick);
  };
  const handleEditProfileClick = () => {
    document.querySelector('.popup_type_edit').classList.add('popup_open');
    document.querySelector('.profile__change').addEventListener('click', handleEditProfileClick);
  };
  const handleAddPlaceClick = () => {
    document.querySelector('.popup_type_edit').classList.add('popup_open');
    document.querySelector('.profile__button').addEventListener('click', handleAddPlaceClick);
  };

  return (
    <div className="content">
      <div className="profile">
        <div className="profile__container">
          <img className="profile__avatar" alt="avatar" />
          <button
            type="button"
            className="profile__change"
            id="show-popup-avatar"
            aria-label="Изменить аватар"
            onClick={handleEditAvatarClick}
          ></button>
        </div>
        <div className="profile__info">
          <h1 className="profile__title">Жак-Ив Кусто</h1>
          <button type="button" className="profile__select-button" id="show-popup"></button>
          <p className="profile__subtitle">Исследователь океана</p>
        </div>
        <button type="button" className="profile__button" id="show-popup-new"></button>
      </div>

      <div className="elements">
        <ul className="elements__list"></ul>
      </div>
    </div>
  );
}

export default Main;
